import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Card from './Card';
import sun from '../images/sun.png';
import rain from '../images/rain.png';

const currentWeather = {
  day: 'Monday',
  wheatherImage: sun,
  dayTemperature: '20℃',
  nightTemperature: '15℃'
}

const otherWeather = {
  day: 'Wednesday',
  wheatherImage: rain,
  dayTemperature: '15℃',
  nightTemperature: '9℃'
}

export default class App extends React.Component{
  render(){
    function Index() {
      return <h2>show </h2>;
    }
    
    function monday() {
      return <Card currentWeather={currentWeather} />;
    }
    
    function wednesday() {
      return <Card currentWeather={otherWeather} />;
    }
    return (
      <Router>
        {/* <div className='card-group'>
          <Card currentWeather={currentWeather} />
          <Card currentWeather={otherWeather} />
        </div> */}
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/">show </Link>
              </li>
              <li>
                <Link to="/monday/">monday</Link>
              </li>
              <li>
                <Link to="/wednesday/">wednesday</Link>
              </li>
            </ul>
          </nav>

          <Route path="/" exact component={Index} />
          <Route path="/monday/" component={monday} />
          <Route path="/wednesday/" component={wednesday} />
        </div>
      </Router>
    )
  }
}
